import React from 'react'
import { Box } from '@mui/material'
import html from "../media/htmlImg.png"

const skills = () => {

  return (
    <Box>
        <Box>
        <img src={htmlImg} alt={htmlImg} />
        </Box>
    </Box>
  )
}

export default skills
